import React from 'react'

export const VaccineList = () => {
  return (
    <div>
        {state.newVaccine.map((data, index)=>(
         <div key={index}>
            <h1>Name: {data.name}</h1>
            <h1>Date: {data.date}</h1>
            <h1>Vaccine: {data.vaccine}</h1>
            <button>Delete</button>
        </div>
      ))}
    </div>
  )
}
